function getTheCoderLookup(latValue, longValue) {
  //get the floors and make sure they don't go over max values
  //179 for latitude (when adding 90); 359 for longitude	
  var latfloor = Math.floor(latValue + 90) > 179 ? 179 : Math.floor(latValue + 90); 
  var longfloor = Math.floor(longValue + 180) > 359 ? 359 : Math.floor(longValue + 180);

  //get my latitude code by finding where in the array my latitude belongs
  var minLatIdx = latfloor == 0 ? 0 : latfloor - 1;
  var maxLatIdx = latfloor == 179 ? 179 : latfloor  + 1;
  var minLongIdx = longfloor == 0 ? 0 : longfloor - 1;
  var maxLongIdx = longfloor == 359 ? 359 : longfloor  + 1;
  var latCoderCode = 0;
  var longCoderCode = 0;

  //Is the users' latitude and longit value in between the max and min positions on our arrays?
  for(var i = minLatIdx; i < maxLatIdx + 1; i++) {
    //now loop through this 3 dimensional array for the actual latitude value lookup
    for(var x = 0; x < lat_min[i].length; x++) {
      if(latValue >= lat_min[i][x] && latValue <= lat_max[i][x]) {
        latCoderCode = lat_coder[i][x];
        break;
      }
    }
  }

  for(var i = minLongIdx; i < maxLongIdx + 1; i++) {
    //now loop through this 3 dimensional array for the actual longitude value lookup
    for(var x = 0; x < long_min[i].length; x++) {
        if(longValue >= long_min[i][x] && longValue <= long_max[i][x]) {
          longCoderCode = long_coder[i][x];
          break;
         }
    }
  }

  return latCoderCode.toString() + longCoderCode.toString();
}


exports.getTheCoderLookup = getTheCoderLookup
